  //{{{  position
  
  cwtchStruct.prototype.position = function (sb, st, sr, sep) {
  
    const b = this.board;
  
    this.wNum = 1;
    this.bNum = 1;
  
    this.netReset();
  
    b.fill(EDGE);
  
    for (let i=0; i < 64; i++)
      b[B88[i]] = 0;
  
    //{{{  board board
    
    let sq   = 0;
    let rank = 7;
    let file = 0;
    
    for (let i=0; i < sb.length; i++) {
    
      const ch   = sb.charAt(i);
      const sq88 = (7-rank) * 8 + file;
      const sq   = B88[sq88];
    
      switch (ch) {
        //{{{  1-8
        
        case '1':
          file += 1;
          break;
        case '2':
          file += 2;
          break;
        case '3':
          file += 3;
          break;
        case '4':
          file += 4;
          break;
        case '5':
          file += 5;
          break;
        case '6':
          file += 6;
          break;
        case '7':
          file += 7;
          break;
        case '8':
          break;
        
        //}}}
        //{{{  /
        
        case '/':
          rank--;
          file = 0;
          break;
        
        //}}}
        //{{{  black
        
        case 'p':
          b[sq] = B_PAWN;
          this.netAdd(B_PAWN, sq);
          this.bList[this.bNum++] = sq;
          file++;
          break;
        case 'n':
          b[sq] = B_KNIGHT;
          this.netAdd(B_KNIGHT, sq);
          this.bList[this.bNum++] = sq;
          file++;
          break;
        case 'b':
          b[sq] = B_BISHOP;
          this.netAdd(B_BISHOP, sq);
          this.bList[this.bNum++] = sq;
          file++;
          break;
        case 'r':
          b[sq] = B_ROOK;
          this.netAdd(B_ROOK, sq);
          this.bList[this.bNum++] = sq;
          file++;
          break;
        case 'q':
          b[sq] = B_QUEEN;
          this.netAdd(B_QUEEN, sq);
          this.bList[this.bNum++] = sq;
          file++;
          break;
        case 'k':
          b[sq] = B_KING;
          this.netAdd(B_KING, sq);
          this.bList[0] = sq;
          this.kings[1] = sq;
          file++;
          break;
        
        //}}}
        //{{{  white
        
        case 'P':
          b[sq] = W_PAWN;
          this.netAdd(W_PAWN, sq);
          this.wList[this.wNum++] = sq;
          file++;
          break;
        case 'N':
          b[sq] = W_KNIGHT;
          this.netAdd(W_KNIGHT, sq);
          this.wList[this.wNum++] = sq;
          file++;
          break;
        case 'B':
          b[sq] = W_BISHOP;
          this.netAdd(W_BISHOP, sq);
          this.wList[this.wNum++] = sq;
          file++;
          break;
        case 'R':
          b[sq] = W_ROOK;
          this.netAdd(W_ROOK, sq);
          this.wList[this.wNum++] = sq;
          file++;
          break;
        case 'Q':
          b[sq] = W_QUEEN;
          this.netAdd(W_QUEEN, sq);
          this.wList[this.wNum++] = sq;
          file++;
          break;
        case 'K':
          b[sq] = W_KING;
          this.netAdd(W_KING, sq);
          this.wList[0] = sq;
          this.kings[0] = sq;
          file++;
          break;
        
        //}}}
        default:
          console.log('unknown board char','|'+ch+'|');
      }
    }
    
    //}}}
    //{{{  board turn
    
    if (st == 'w')
      this.turn = WHITE;
    
    else if (st == 'b')
      this.turn = BLACK;
    
    else
      console.log('unknown board colour', st)
    
    //}}}
    //{{{  board rights
    
    this.rights = 0;
    
    for (let i=0; i < sr.length; i++) {
    
      const ch = sr.charAt(i);
    
      if (ch == 'K') this.rights |= WHITE_RIGHTS_KING;
      if (ch == 'Q') this.rights |= WHITE_RIGHTS_QUEEN;
      if (ch == 'k') this.rights |= BLACK_RIGHTS_KING;
      if (ch == 'q') this.rights |= BLACK_RIGHTS_QUEEN;
    }
    
    //}}}
    //{{{  board ep
    
    if (sep.length == 2)
      this.ep = COORDS.indexOf(sep)
    
    else
      this.ep = 0;
    
    //}}}
  
    this.hashCalc()
  
  }
  
